//同步引入
//依赖jquery,jquery.cookie.js
let setSaUrl = {
    'vipkid': 'https://sensorsdata.vipkid.com.cn/sa',
    'testvipkid': 'http://sc.vipkid.com.cn:8006/sa?project=test'
  };
(function (para) {
  var n = para.name;
  window['sensorsDataAnalytic201505'] = n;
  window[n] = {
    _q: [],
    _t: 1 * new Date(),
    para: para
  };
})({
  show_log: false,
  is_single_page: true,
  name: 'sa',
  server_url: getSa()
});

function getSa() {
  if (window.location.hostname === 'lc.vipkid.com.cn' || window.location.hostname === 'pre-lc.vipkid.com.cn') {
    return setSaUrl['vipkid']
  } else {
    return setSaUrl['testvipkid']
  }
}
